import {useState} from 'react';

function Todo(props) {
  
    function deleteHandler(props){
        console.log('clicked');
        console.log(props.text);

    }
  
    return (
    <div className="card">
      <h2>{props.text}</h2>
      <div className="actions">
        <button onClick={deleteHandler} className="btn">delete</button>
      </div>
    </div>
  );
}

export default Todo;
